import  gql from "@apollo/client";

export const GET_LIST = gql`
query getRepositoryQuery(
    $repoNameString: String!
    $after: String
    $limit: Int!
  ) {
    search(
      query: $repoNameString
      first: $limit
      after: $after
      type: REPOSITORY
    ) {
      pageInfo {
        startCursor
        hasNextPage
        endCursor
      }
      edges {
        node {
          ... on Repository {
            name
            url
            description
            updatedAt
          }
        }
      }
    }
  }
`;
